import React, {Component} from 'react';
import 'materialize-css/dist/css/materialize.min.css';

class Home extends Component {

    render() {
        return(
        <div>
            <div className="row">
            <div className="grid-example col s12 style={{
                backgroundColor:'red'
            }}" ><span class="flow-text">I am always full-width (col s12)</span></div>
            <div className="grid-example col s12 m6"><span class="flow-text">I am full-width on mobile (col s12 m6)</span></div>
            </div> 
        </div>
        )
    }
}

export default Home;
